import React from 'react';
import styled from 'styled-components';
import Logo from './Logo';

const Navbar = () => {
  return (
    <NavbarContainer>
      <Logo />
      <NavLinks>
        <NavItem><NavLink href="/">Home</NavLink></NavItem>
        <NavItem><NavLink href="/about">About Us</NavLink></NavItem>
        <NavItem><NavLink href="/case-studies">Case Studies</NavLink></NavItem>
        <NavItem><NavLink href="/services">Services</NavLink></NavItem>
        <NavItem><NavLink href="/contact">Contact Us</NavLink></NavItem>
      </NavLinks>
    </NavbarContainer>
  );
};

// Styled Components
const NavbarContainer = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 20px 40px;
  position: relative;
  z-index: 10;
  width: 100%;

  @media (max-width: 768px) {
    padding: 20px;
  }
`;

const NavLinks = styled.ul`
  display: flex;
  gap: 30px;

  @media (max-width: 768px) {
    display: none;
  }
`;

const NavItem = styled.li`
  position: relative;
`;

const NavLink = styled.a`
  color: #fff;
  font-weight: 500;
  font-size: 0.9rem;
  transition: color 0.3s ease;
  padding: 5px 0;

  &:hover {
    color: #2ec4b6;
  }

  &:first-child {
    color: #2ec4b6;
  }
`;

export default Navbar;
